import React from 'react';
import Navbar from './Navbar/Navbar'
import Header from './Header/Header'

import '../css/bootstrap.css'
import '../css/animate.css'
import '../css/style.css'


const Components = () => {
  return (
    <>
      <Navbar/>
      <Header/>
    </>
  );
};

export default Components;
